import React, { Component } from 'react';

export default class TaskList extends Component {
    render() {
        let checklist = this.props.tasks.map((task, index) => {
            if (`${task.taskTitle}` === '') {
                return null
            } else {
                return (
                    <li key={index}>
                        <input type="checkbox"/>{task.taskTitle}
                    </li>
                )
            }
        })

       return(
           <div className="TaskList">
                <ul>{checklist}</ul>
            </div>
        )
    }
}
